function cursos() {
  return (
    <div className="container">
      <h4>Courses</h4>
      <div className="row">
        <div className="col-6 col-sm-12">
          <div className="row">
            <div className="col-3 col-md-12">
                imagen del curso
            </div>
            <div className="col-9 col-md-12">
                Texto del curso
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default cursos;
